import React, { Fragment } from "react";
import { Link } from "react-router-dom";
import { Tab, Nav,Dropdown } from "react-bootstrap";

//**  Import Single Job Components */
import Customermap from './Analyticsapexcustommap';
import Chartcircle from './ApexChartcircle';
import Donught2 from "../../charts/Chartjs/donught2";
import Apexchartrevenue from './Apexchartrevenue';
import {  Sparklines, SparklinesLine } from 'react-sparklines';

const sampleData1 = [5,6,4,3,4,3,4,3,6,5,6,4,5,2,3,4,2,1,5,3];
const sampleData2 = [8,5,3,1,2,4,5,7,3,4,6,2,4,6,7,6,3,4,5,3];
const sampleData3 = [6,5,2,5,4,7,8,7,6,5,6,4,3,4,3,4,3,6,7,6];
 const tabData = [
      { name: "All Categories", content:"", },
      { name: "Main Course", content:"", },
      { name: "Pizza",content:"", },
      { name: "Drink",content:"", },
	  { name: "Dessert",content:"", },
	  { name: "More",content:"",  },

   ];

const Analytics = () => {

   return (
        <Fragment>

	<div class="container">
        <div class="row py-1">
            <div class="col-10 text-center list-group-item list-group-item">
    <form>
        <div class="form-group">
          <label for="exampleInputEmail1">NOMINA</label>
          <input type="email" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Nomina"/>

        </div>
        <div class="form-group">
          <label for="exampleInputPassword1">NOMBRE</label>
          <input type="password" class="form-control" id="exampleInputPassword1" placeholder="Nombre"/>
        </div>
        <div class="form-group">
            <label for="exampleInputPassword1">CEDULA</label>
            <input type="password" class="form-control" id="exampleInputPassword1" placeholder="Cedula"/>
          </div>
          <div class="form-group">
            <label for="exampleInputPassword1">TELEFONO</label>
            <input type="password" class="form-control" id="exampleInputPassword1" placeholder="Telefono"/>
          </div>
          <div class="form-group">
            <label for="exampleInputPassword1">CARGO</label>
            <input type="password" class="form-control" id="exampleInputPassword1" placeholder="Cargo"/>
          </div>
          <div class="form-group">
            <label for="exampleInputPassword1">DIRECCION</label>
            <input type="password" class="form-control" id="exampleInputPassword1" placeholder="Direccion"/>
          </div>

        <button type="submit" class="btn btn-primary">REGISTRAR</button>
      </form>
      </div>
    </div>
</div>


        </Fragment>
	);
};

export default Analytics;
